
class Board:
	def __init__(self):
		self.b = [[0,0,1,0,0],
				  [0,2,3,4,0],
				  [5,6,7,8,9],
				  [0,0xA,0xB,0xC,0],
				  [0,0,0xD,0,0]]
		self.row = 2
		self.col = 0
	def __str__(self):
		return str(self.row) + ", " +str(self.col) + " --> " + str(self.b[self.row][self.col])
	def up(self):
		if self.row == 0:
			return
		if self.b[self.row-1][self.col]==0:
			return
		self.row = self.row - 1
	def down(self):
		if self.row == 4:
			return
		if self.b[self.row+1][self.col]==0:
			return
		self.row = self.row + 1
	def left(self):
		if self.col == 0:
			return
		if self.b[self.row][self.col-1]==0:
			return
		self.col = self.col -1
	def right(self):
		if self.col == 4:
			return
		if self.b[self.row][self.col+1]==0:
			return
		self.col = self.col + 1
	def read(self,s):
		for c in s:
			if c == "U":
				self.up()
			if c == "D":
				self.down()
			if c == "L":
				self.left()
			if c == "R":
				self.right()
		return hex(self.b[self.row][self.col])

